import React from "react";
import TeamMember from './TeamMember';

function Team(){
    let info = [
        {id:1,  name: "Jon Snow",  img: "./img/Jon_snow.jpg",  position: "Kit Harington",  phone: "0541412724",    email: 'King@gmail.com',    website: "ironThrone.com"},
        {id:2,  name: "Cersei Lannister",   img: "./img/cersei.jpg",    position: "Lena Headey",    phone: "0500000000",    email: 'Queen@gmail.com',   website: "ironThrone.com"},
        {id:3,  name: "Daenerys Targaryen",     img: "./img/daenerys.jpg",      position: "Emilia Clarke",     phone: "0599999999",    email: 'calisi@gmail.com',     website: "ironThrone.com"},
        {id:4,  name: "Terrian Lannister",      img: "./img/terrian.jpg",   position: "Peter Dinklage",   phone: "0511111111",     email: 'Hand@gmail.com',   website: "ironThrone.com"},
        {id:5,  name: "Arya Stark",     img: "./img/arya.jpg",      position: "Maisie Williams",       phone: "0000000000",    website: "ironThrone.com"},
        {id:6,  name: "Sansa Stark",        img: "./img/sansa.jpg",     position: "Sophie Turner",      phone: "0000000000",       email: 'north@gmail.com',   website: "ironThrone.com"},
    ]
    info.map(function(member){
        return(
            <TeamMember
                name={member.name}
                img={member.img}
                img={member.img}

            />
        )
    })
    return(
        <div className="row">
            <TeamMember
                info = {{
                    name: "Jon Snow",
                    img: "./img/Jon_snow.jpg",
                    position: "Kit Harington",
                    phone: "0541412724",
                    email: 'King@gmail.com',
                    website: "ironThrone.com"

                }}
            />
            <TeamMember
                info = {{
                    name: "Cersei Lannister",
                    img: "./img/cersei.jpg",
                    position: "Lena Headey",
                    phone: "0500000000",
                    email: 'Queen@gmail.com',
                    website: "ironThrone.com"

                }}
            />
            <TeamMember
                info = {{
                    name: "Daenerys Targaryen",
                    img: "./img/daenerys.jpg",
                    position: "Emilia Clarke",
                    phone: "0599999999",
                    email: 'calisi@gmail.com',
                    website: "ironThrone.com"

                }}
            />
            <TeamMember
                info = {{
                    name: "Terrian Lannister",
                    img: "./img/terrian.jpg",
                    position: "Peter Dinklage",
                    phone: "0511111111",
                    email: 'Hand@gmail.com',
                    website: "ironThrone.com"

                }}
            />
            <TeamMember
                info = {{
                    name: "Arya Stark",
                    img: "./img/arya.jpg",
                    position: "Maisie Williams",
                    phone: "0000000000",
                    website: "ironThrone.com"

                }}
            />
            <TeamMember
                info = {{
                    name: "Sansa Stark",
                    img: "./img/sansa.jpg",
                    position: "Sophie Turner",
                    phone: "0000000000",
                    email: 'north@gmail.com',
                    website: "ironThrone.com"

                }}
            />

        </div>

    ) 
}
export default Team;
